import java.util.HashMap;

public class SpecialStrings {
    public static void main(String[] args) {

//        String s = "asasd";
//        String s = "abcbaba";
//        String s = "aaaa";
        String s = "";
        System.out.println("The string is: " + substrCount(s.length(), s));
    }

    public static long substrCount(int n, String s) {
        int specials = 0;

        for(int start = 0; start < s.length(); start++) {

            for(int end = start + 1; end < s.length(); end++) {
                String sub = s.substring(start, end + 1);
                if(isSpecialString(sub)) specials++;
            }

        }

        return specials + n;
    }

    public static boolean isSpecialString(String s) {
        final HashMap<Character, Integer> freqMap = new HashMap<>();

        for(Character c : s.toCharArray()) freqMap.put(c, freqMap.getOrDefault(c, 0) + 1);

        if(freqMap.size() == 1) return true;

        if(freqMap.size() > 2) return false;

        if(s.length() % 2 == 0) return false;

        int midCharIndex = (s.length() - 1) / 2;
        Integer midCharFreq = freqMap.get(s.charAt(midCharIndex));

        return midCharFreq == 1;

    }

}
